import React from "react";
import { Link } from "react-router-dom";

import classes from "./Pofol.module.css";

const Pofol = (props) => {
  if (props.items.length > 6) {
    console.log("6개 이상");
  } else {
    console.log("6개 미만");
  }
};

export default Pofol;
